import React from 'react';
import './App.css';

// import LinkNavigation from "./components/atoms/LinkNavigation"

function App() {
  const showPath = () => {
    console.log(window.location.pathname)
  }

  return (
    <div className="App">
      <nav>
        <img src=".//components/logo192.png" alt="test" />
        {/* <LinkNavigation link="#" text="Test" /> */}
        {showPath()}
      </nav>
    </div>
  );
}

export default App;
